import PropTypes from "prop-types";

const Header = ({ title }) => {
  return (
    <header>
      <h1 style={{ headingStyle }}>{title}</h1>
    </header>
  );
};

// Set default properties
Header.defaultProps = {
  title: "Task Tracker",
};

// Set property types
Header.propTypes = {
  title: PropTypes.string.isRequired,
};

const headingStyle = {
  color: "red",
  backgroundColor: "black",
};

export default Header;
